import React from "react";
import { Card, Container } from "react-bootstrap";

const LogoutConfirmation = () => {
  return (
    <div>
      <br />
      <Container>
        <Card className="text-center" bg="success">
          <Card.Body>
            <Card.Title>Logged out successfully!</Card.Title>
            <Card.Text>
              {/* Click <a href="/login">here</a> to go back to the login page! */}
              Click <Card.Link href="/login">here</Card.Link> to go back to the
              login page!
            </Card.Text>
          </Card.Body>
        </Card>
      </Container>

      <br />
    </div>
  );
};

export default LogoutConfirmation;
